import React from 'react';
import NavBar from '../Others/NavBar';
import RegistrationForm from '../Others/RegistrationForm';

const Registration = () => {
    return (
        <div>
            <NavBar></NavBar>
            <RegistrationForm/>
        </div>
    );
};

export default Registration;
